import React from 'react'
import { Link } from 'react-router-dom'

const getTitle = (note) => {

    let title = note.body.split('\n')[0]
    return title
}


const ListItem = ({ note }) => {


    return (
        <div>
            <Link to={`/note/${note.id}`}>
                <div className='notes-list-item'>
                    <h3> {note.body} </h3>
                </div>
            </Link>
        </div>
    )
}

export default ListItem;
